import { Link } from "react-router-dom";

function AllKits() {
  return (
    <div className="zipper">
      <Link to="/blackbag">Black kit</Link>
      <Link to="/orangebag">Orange kit</Link>
      <Link to="/greenbag">Green kit</Link>
    </div>
  );
}

export default AllKits;
